import request from 'request';
export default {
  name: 'Personalinforadm',
  data() {
    return {
      html: ''
    };
  },
  created() {
    this.loadHtml();
  },
  methods: {
    loadHtml() {
      request({
        url: '/systemstatus/html',
        method: 'get'
      }).then(resp => {
        this.html = resp.data;
      }).catch(error => {
        console.log(error);
      });
    }
  }
};
